import { connect } from 'react-redux';
import TextField from '@material-ui/core/TextField';

import {
    AppBar,
    Button
} from '../../components';
import './styles.css';


class AddroutineComponent extends Component {
    constructor(props) {
    super(props);
    this.state = {
      routines: [],
      key: ''
    };
  }
    render() {
        return (
            <div>
                <AppBar/>
                <br />
                <div class="page-content">
                    <h3>Add Routine</h3>
                    {/* <input className="myinput"
                    placeholder="pls input"></input> */}
                    <TextField required id="name" label="Rountine Name"  margin="normal"/>
                    <br />
                    <TextField required id="name" label="Rountine Name"  margin="normal"/>
                    <br />
                    <TextField id="name" label="..."  margin="normal"/>
                    <br />
                    <TextField id="name" label="..."  margin="normal"/>
                    <br />
                    <TextField id="name" label="..."  margin="normal"/>
                    <br /><br />
                    <Button name={"Add"}/>
                </div>
            </div>
        );
    }
}

export { AddroutineComponent };

const mapStateToProps = (state, ownProps) => {
    return {
        ...ownProps
    };
};

export const Addroutine = connect(mapStateToProps, {

})(AddroutineComponent);
